import axios from "axios";

const HelloWorld = () => {

  const fetchData = () => {
    return axios.get("http://localhost:8800/")
       .then((response) => console.log(response.data));

    }

    function App() {
      return (
        <div className="app">
          <h1>Hello World!</h1>
        </div>
      );
    }

  // function sayHello() {
  //   alert('Hello, World!');
  // }

  return (
    <button onClick={App}>Send GET Request to backend API!</button>
  );
};

export default HelloWorld;
